import { useSelector } from "react-redux";
import { useRouter } from "next/router";
import { useEffect } from "react";
import Navigation from "../../components/navigation/Navigation";
import classes from './dashboard.module.scss';
import RoguePic from '../../components/assets/images/rogue.png'
const dashboard = () => {
  const router = useRouter();
  const isLoaded = useSelector((state) => state.auth.isLoaded);
  const user = useSelector((state) => state.auth.user);
  useEffect(() => {
    if (!isLoaded) {
      router.push("/");
    }
  }, []);
    console.log(RoguePic, 'roguePic')
  return (
    <div>
      <Navigation />
        <img src={RoguePic} alt="Class"/>
      <h1>Hello Heroe {user?.email}!</h1>
      <div className={classes.Dashboard}>
        <h2>Stats table </h2>
        <h5>Class: {user?.role}</h5>
        <h5>Level: {user?.level}</h5>
        <h5>Experience: {user?.experience}</h5>
        <h5>Gold: {user?.gold}</h5>
        <h5>Stamina: {user?.stamina}</h5>
      </div>
    </div>
  );
};

export default dashboard;
